                                    <div class="title2">О товаре</div>
                                    <p>
                                        14-дюймовый бизнес-ноутбук Dell Latitude 5480 является обновлённой версией Latitude 14 E5470.
                                        Эти модели характеризуются спокойным дизайном "без претензий", прочным корпусом, и привлекательным
                                        набором функций безопасности. "Массовая" серия Latitude 5000 находится где-то посередине между менее
                                        дорогим семейством 3000 "начального уровня" и "премиум" серией 7000.
                                    </p>
                                    <p>
                                        Низкая цена минимальной конфигурации этого 14-дюймового середнячка Dell (начинающаяся с 770 долларов)
                                        способна усыпить бдительность, но может быстро взлететь до небес: начальный вариант включает процессор
                                        Core i3, 4 ГБ памяти и 2.5-жёсткий диск 500 ГБ, тогда как наш ноутбук с экраном с поддержкой прикосновений
                                        оборудован процессором i7, 8 ГБ памяти и твердотельным диском 256 ГБ - цена такой конфигурации уже 1550
                                        долларов (немногим более, чем в 2 раза выше). Максимальная конфигурация по всем параметрам опустошит ваш
                                        кошелёк на более чем 2000 долларов.
                                    </p>
                                    <p>
                                        Разумеется, у этого 14-дюймового бизнес-ноутбука есть конкуренты. Во время обзора мы посмотрим, как наш
                                        Latitude 5480 сравнится с другими бизнес-ноутбуками вроде Lenovo ThinkPad T460s, новым Lenovo ThinkPad
                                        T470, HP ProBook 440 G4, и Acer TravelMate P648.
                                    </p>
                                    <p>
                                        Низкая цена минимальной конфигурации этого 14-дюймового середнячка Dell (начинающаяся с 770 долларов)
